import React from 'react';
import IntroTextContainer from './questionsContainer';
import viewQuestions from './questionsView'

export class IntroTextLayout extends React.Component {
    render() {
      if(intro) {
        return (
          <IntroTextContainer intro={intro}/>
        );
      } else {
        return (
          <viewQuestions />
        );
      }
    }
}
